import Head from "next/head";
import React, { useState, useEffect } from "react";

import Axios from "axios";

function Page() {
  const [data, setData] = useState();
  const url = "https://aguaviva-rp.firebaseio.com/movimentacoes/2019.json";

  useEffect(() => {
    Axios.get(url).then((res) => {
      setData(res.data);
    });
  }, []);

  return (
    <>
      <div>teste</div>
      {data}
    </>
  );
}

export default Page;
